import React from "react";

const DragAndDrop = () => {
  return (
    <div className="file-upload-wrapper">
      <input
        type="file"
        id="input-file-now"
        className="file-upload"
        onClick={function () {
          {
            var fileName = this.value.split("\\").pop();
            alert(fileName)
          }
        }}
      />
    </div>
  );
};

export default DragAndDrop;
